import React from 'react';
import logo, { ReactComponent } from './logo.svg';
import './App.css';

export default class App extends React.Component {

  constructor(){
    super();
    this.state = {
      name: "Alfonso",
      food: "pasta"
    }
  }


  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1>Hello Worl</h1>
        </header>
      </div>
    );
  }
}
